import React from "react";
import { Box, Typography } from "@mui/material";

export default function Footer() {
    return (
        <Box mt={3} bgcolor="primary.main" position="absolute" bottom="0px" sx={{width: "100%", height: "5%"}}>
            <Typography sx={{}} align="center">
                Copyright (c) Geir Ola Tvinnereim
            </Typography>
            <Box />
            <Typography sx={{pb: 1}} align="center">
                2023
            </Typography>
        </Box>
    );
}
